
import bz2
import base64
import functools
from io import StringIO

import pandas as pd

from loguru import logger


logger.disable(__name__)


@functools.cache
def load_yang5_regime_grid():
    compressed_string = YANG5_REGIME_DATA
    compressed_byte_string = base64.b64decode(compressed_string.encode('utf-8'))
    byte_string = bz2.decompress(compressed_byte_string)
    return pd.read_csv(StringIO(byte_string.decode('utf-8'))).set_index(['lon', 'lat'], drop=True)


YANG5_REGIME_DATA = ""
